(function() {
  var social, update;

  social = {
    facebook: {
      url: function(url) {
        return "//graph.facebook.com/?id=" + url;
      },
      extract: function(_arg) {
        var shares;
        shares = _arg.shares;
        return shares;
      }
    },
    twitter: {
      url: function(url) {
        return "//cdn.api.twitter.com/1/urls/count.json?url=" + url + "&callback=?";
      },
      extract: function(_arg) {
        var count;
        count = _arg.count;
        return count;
      }
    },
    linkedin: {
      url: function(url) {
        return "//www.linkedin.com/countserv/count/share?url=" + url + "&callback=?&format=jsonp";
      },
      extract: function(_arg) {
        var count;
        count = _arg.count;
        return count;
      }
    }
  };

  update = function($element, url) {
    var service;
    service = social[$element.data("share-counter")];
    return $.getJSON(service.url(url), function(response) {
      var count;
      count = service.extract(response);
      if (count > 0) return $element.text(" (" + count + ")");
    });
  };

  $(function() {
    var url;
    url = $("[data-page-url]").data("page-url");
    return $("[data-share-counter]").each(function() {
      return update($(this), url);
    });
  });

}).call(this);
